import React from 'react';
import './WhatWeOffer.scss';
import Cards from '../../../components/Cards/Cards';

export default function WhatWeOffer() {
  return (
    <section className="what-we-offer">
      <h3>What we offer</h3>
      <div>
        <Cards />
      </div>
    </section>
  );
}
